import React from "react";
import Jumbotron from "../components/Jumbotron";
import { Col, Row, Container } from "../components/Grid";
import { FormBtn } from "../components/Form";

function Home() {
    return (
        <Container fluid>
            <Row>
                <Col size="md-6">
                    <Jumbotron>
                        <h1>You Can Do This.</h1>
                    </Jumbotron>
                </Col>
            </Row>
            <Row>
                <Col size="sm-6">
                    <FormBtn>Add</FormBtn>
                </Col>
                <Col size="sm-6">
                    <FormBtn>Start</FormBtn>
                </Col>
            </Row>
        </Container>
    )
}

export default Home;
